import React, { Component } from "react";
import Select from 'react-select-me';
import 'react-select-me/lib/ReactSelectMe.css';
import { TopStock } from "./TopStock";
import "./App.css";

const options = [
    { value: 1, label: 'Sector 1' },
    { value: 2, label: 'Sector 2' },
    { value: 3, label: 'Sector 3' },
    { value: 4, label: 'Sector 4' }
  ];

class SectorFilter extends Component {
    constructor(props) {
        super(props);
        this.state = { value: null };
        this.onChange = this.onChange.bind(this);
    }

    onChange(value) {
        this.setState({ value });
    }

    render() {
        return <Select options={options} value={this.state.value} onChange={this.onChange} />;
    }
}

export {
    SectorFilter
}
